import React from 'react';
import data from "../akademii.json";
const AkademiiCards = () => {
    console.log(data);
    
    return ( <div className="academii-crds">
       { data.map(card => (
            <div>
            <h1>{card.title}</h1>  
            <img src={data.image}></img>  
            </div>
       ))}
    </div> );
}
 
export default AkademiiCards;
